import Typed from "typed.js";

export const heroLogic = () => {
  console.log("hello");
  const dynamicTextOptions = {
    strings: [
      "I am a nait graduate",
      "I am a coder",
      "I am a dungeon master",
      "I am a cat mom",
      "I am a coffee addict",
    ],
    typeSpeed: 80,
    backSpeed: 80,
    loop: true,
    smartBackspace: true,
    shuffle: true,
  };

  const dynamicText = new Typed(".hero-h1-dynamic-text", dynamicTextOptions);
};

export const heroLogicFix = () => {
  console.log("hi");
  const cursorToDelete = document.querySelector(".hero-div-text-container");
  cursorToDelete.removeChild(cursorToDelete.lastElementChild);
};
